import logo from './logo.svg';
import './App.css';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { Component, useState } from 'react';
import { Collapse, Container, Row, Col } from 'react-bootstrap';

class App extends Component {
  state = {

  }

  render() {
    return(
      <div className="App-header">
        <header className="header">
          <h1 className="title">Twatter</h1>
          <Button className="login" variant="primary">Log in</Button>
          <Button className="signup" variant="primary">Sign up</Button>
        </header>

        <Container>
          <Row>
            <Collapse>
              <Col md={9} className="userUI" id="example-collapse-text">hello</Col>
              <Col md={3}>Noob</Col>
            </Collapse>
          </Row>
        </Container>

      </div>
    );
  }
}


export default App;
